namespace Pusher\Tests\Channels;

use PHPUnit\Framework\TestCase;
use Pusher\Channel\WeCom;
use Pusher\Message\WeComMessage;

class WeComTest extends TestCase
{
    private string $token = '';

    public const PASS = false;

    public function setUp(): void
    {
        $this->token = getenv('WeComToken');
    }

    public function skipTest(string $func, bool $skip = false): void
    {
        if (self::PASS || $skip) {
            $this->markTestSkipped("skip ${func}");
        }
    }

    // 延时
    public function timeSleep(int $time = 5): void
    {
        sleep($time);
    }

    public function additionProviderTextMarkdown(): array
    {
        $at = [
            'mentionedList' => [ 'jetsung' ],
            'mentionedMobileList' => [],
        ];

        $at2 = array_merge($at, [ 'mentionedList' => [ '@all' ] ]);
        $at3 = array_merge($at, [ 'mentionedMobileList' => [ '@all' ] ]);

        return [
            ['text', 'TEXT 消息内容', '', $at],
            ['text', 'TEXT 消息内容 at all uid', '', $at2],
            ['text', 'TEXT 消息内容 at all mobile', '', $at3],
            ['markdown', "#### 杭州天气 @150XXXXXXXX \n > 9度，西北风1级，空气良89，相对温度73%\n > ![screenshot](https://p.qpic.cn/pic_wework/3887590517/1e18b50e1f1517a6328199454b42c9501fe22d7ddcc2457d/0)\n > ###### 10点20分发布 [天气](https://www.dingtalk.com) \n", '', $at],
        ];
    }

    public function additionProviderImage(): array
    {
        $md5 = '2a0415022dd96297190a9e81a894587e';
        $base64 = '';

        return [
            [ $md5, $base64 ],
        ];
    }

    /**
     * @dataProvider additionProviderTextMarkdown
     *
     * @return void
     */
    public function testTextMarkdownCases(
        string $msgtype,
        string $content,
        string $title = '',
        array $at = [],
    ): void {
        $this->skipTest(__METHOD__);
        $this->timeSleep(5);

        $channel = new WeCom();
        $channel->setToken($this->token);

        $message = new WeComMessage($msgtype, $content, $title);
        $message->setMentionedList($at['mentionedList'])
            ->setMentionedMobileList($at['mentionedMobileList']);

        $channel->requestContent($message);
        $this->assertTrue($channel->getStatus());
    }

    /**
     * @dataProvider additionProviderImage
     *
     * @return void
     */
    public function testImageCase(string $md5, string $base64): void
    {
        $this->skipTest(__METHOD__);
        $this->timeSleep(5);

        $channel = new WeCom();
        $channel->setToken($this->token);

        $message = new WeComMessage('image');
        $message->setImageBase64($base64)
            ->setImageMd5($md5);

        $channel->requestContent($message);
        $this->assertTrue($channel->getStatus());
    }

